import { createRouter, createWebHistory } from 'vue-router';
import AppHome from '../componentsUser/componentsHome/AppHome.vue';
import AppBadge from '../componentsUser/componentsService/AppBadge.vue';
import AppUsers from '../componentsUser/componentsService/AppUsers.vue';
import AppTages from '../componentsUser/componentsService/AppTages.vue';
import AppContact from '../componentsUser/componentsService/AppContact.vue';
import AppProfile from '../componentsUser/componrntsProfile/AppProfile.vue';
import AppProfileSetting from '../componentsUser/componrntsProfile/AppProfileSetting.vue';
import AppMyQuistion from '../componentsUser/componrntsProfile/AppMyQuestion.vue';
import AppAnswers from '../componentsUser/componentsHome/AppAnswers.vue';
import AppAboutUs from '../componentsUser/componentsHome/AppAboutUs.vue';
import AppAskQuesion from '../componentsUser/componentsHome/AppAskQuesion.vue';


import AppAdmin from '../componentsUser/componentsAdmin/AppAdmin.vue';

const routes = [
    {name: 'Home', path: '/', component: AppHome},
    {name: 'Servises/Badges', path: '/Servises/Badges', component: AppBadge},
    {name: 'Servises/Users', path: '/Servises/Users', component: AppUsers},
    {name: 'Servises/Tages', path: '/Servises/Tages', component: AppTages},
    {name: '/ContactUs', path: '/ContactUs', component: AppContact},
    {name: '/Profile', path: '/Profile', component: AppProfile},
    {name: '/Settings', path: '/Settings', component: AppProfileSetting},
    {name: '/MyQuistion', path: '/MyQuistion', component: AppMyQuistion},
    {name: '/Answers', path: '/Answers', component: AppAnswers},
    {name: '/AboutUs', path: '/AboutUs', component: AppAboutUs},
    {name: '/AskQuesion', path: '/AskQuesion', component: AppAskQuesion},
    
];

const router = createRouter({
    history: createWebHistory(),
    routes
})

export default router;
